import React from 'react';
import { Link, NavLink } from 'react-router-dom';

const Navbar = () => {
    return(
        <nav className='ui raised very padded segment'>
            <a className='ui teal inverted segment'>Gloria</a>
            <div className='ui right floated header'>
                <button className='ui button'><Link to ='/' className="Link">Home</Link></button>
                <button className='ui button'><Link to ='/about' className="Link">About</Link></button>
                <button className='ui button'><Link to ='/contact' className="Link">Contact</Link></button>
            </div>
        </nav>
    )
}

export default Navbar;
